import {View} from 'react-native';
import style from './OpenPhotoView2.Styles';
import Img2SVG from '../svgFiles/detalleAlbum/img2.svg';

export default function Img2() {
    return (
        <View>
            <Img2SVG/>
        </View>
    )
}
